import React from 'react';
import { Route } from 'react-router-dom';
import Beer from '../components/Beer';
import GetData from '../components/GetData';

/* function BeerwithData() {
  return <GetData>{(beer) => <Beer beer={beer}></Beer>}</GetData>;
} */

function App() {
  return (
    <div className="App">
      <Route path="/:id">
        <GetData>{(beer) => <Beer beer={beer}></Beer>}</GetData>
      </Route>
    </div>
  );
}

export default App;
